import React from 'react';

class LoginNew extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: '',
      password: '',
      passwordConfirm: '',
    }
  };

  handleChange = event => {
    this.setState({ [event.target.name]: event.target.value })
  };



  render() {
    return (
      <form>
        <input type="text" name="username" onChange={this.handleChange} value={this.state.username} placeholder="Username" />
        <input type="password" name="password" onChange={this.handleChange} value={this.state.password} placeholder="Password" />
        <input type="password" name="passwordConfirm" onChange={this.handleChange} value={this.state.passwordConfirm} placeholder="Confirm Password" />
      </form>
    )
  };
};

export default LoginNew;
